import React from 'react';
import { Typography, Grid, Paper, Box} from '@material-ui/core';
import styles from './Header.module.css';
import ProfilePic from './linkedin.jpeg';

function Header() {
    return (
        <div>
            <Grid>
                <Box boxShadow={1} className={styles.header} display="flex" textAlign="right" fontWeight="fontWeightMedium">
                    <img src={ProfilePic} alt="profile"/>
                    <Typography variant="h2">Jamal Dabas</Typography>
                </Box>
            </Grid>
        </div>
    );
}

export default Header;
